                <div class="mx-auto max-w-2xl">
                    <h2 class="font-bold tracking-tight md:text-4xl text-2xl">Meet our team</h2>
                    <p class="mt-4 text-xl leading-8 text-gray-500">Our philosophy is simple, solar is smart, batteries and
                        control systems are even smarter, so we want to educate you on how and why, then install for you to
                        save thousands of pounds, whilst make you feel good about it too!</p>
                    <p class="mt-4 text-xl leading-8 text-gray-500">
                        We have a team of experts in this field with over 50 years combined in solar and battery systems.
                        This is also not our end game either, we are going to be moving into air source heating, off grid
                        systems, battery only systems, as well as few other amazing things which we will reveal later in the
                        year!
